import React from 'react'; 
// React 라이브러리 불러오기 (JSX 문법을 해석하기 위해 필요)

import ReactDOM from 'react-dom/client'; 
// React 18 이상에서 createRoot API 사용을 위해 react-dom/client 에서 import

import './index.css'; 
// 전역 CSS 파일 import

import App from './App'; 
// 최상위 App 컴포넌트 import

import reportWebVitals from './reportWebVitals'; 
// 웹 성능 측정 함수 (옵션)

// BrowserRouter : 리액트 라우터를 쓰기 위한 라우터 컴포넌트
import { BrowserRouter } from 'react-router-dom'; 

// id가 'root'인 DOM 요소를 찾아서 React root를 만들기
const root = ReactDOM.createRoot(document.getElementById('root'));

import { Provider } from "react-redux";
import store from "./modules"; // store.js 경로가 맞아야 함

// root.render()를 이용해서 리액트 앱을 렌더링
root.render(
  <Provider store={store}>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </Provider>
);

// 웹 성능 측정을 위한 함수 호출
// 기본적으로는 아무것도 안 하지만,
// reportWebVitals(console.log) 형태로 넘기면 결과를 볼 수 있음
reportWebVitals();
